import axios from "axios";


export function loadUserData(){
    return(dispatch)=>{
        return axios.get("http://localhost:8080/getReactAssigFormData/sarthak.mehta@aurigait.com").then((response)=>{
            dispatch(changeUserData(response));
        })
    }
}
export function changeUserData(userData){
    return{
        type:"SET_USER_DATA",
        userData:userData
    }
}
